func isValid(s string) string {
	// Write your code here
	strByte := []byte(s)
	mapStr := make(map[string]int, len(strByte))
	for i := 0; i < len(strByte); i++ {
		mapStr[string(strByte[i])] += 1
	}
	fmt.Println(mapStr)

	firstVal := 0
	firstValOccurence := 0
	firstinitial := true
	secondVal := 0
	secondValOccurence := 0
	secondInitial := false
	for _, value := range mapStr {
		if firstinitial {
			secondInitial = true
			firstinitial = false
			firstVal = value
			firstValOccurence = 1
			continue
		}

		if firstVal == value {
			firstValOccurence++
			continue
		}

		if secondInitial {
			secondInitial = false
			secondVal = value
			secondValOccurence = 1
			continue
		}
		if secondVal == value {
			secondValOccurence++
			continue
		}
		fmt.Println("HHSSHSHSHSH")
		return "NO"
	}

	valDiff := firstVal - secondVal
	if valDiff < 0 {
		valDiff = valDiff * -1
	}
	if (firstValOccurence > 1 && secondValOccurence > 1) || valDiff > 1 {
		return "NO"
	}
	return "Yes"
}

